import React from 'react';
import NavItem from './navItem.js';


function HeaderTitle(props){
    return (
      <div style={{border: '4px red solid', display: 'flex', width: 'calc(100% - 8px)'}/* El -8px es por los bordes */} >

        <div style={{width: '60%'}} id="weedway">
          <h2 > <a href="/"> <img src="favicon.ico" alt="Canabis" /> WeedWay </a> </h2>
        </div>
        <button style={{width: '30%'}} className="nav-button" onClick={ ()=>{ props.setEstado('Buscar') } } > <i className={props.icon + ' navIcon'} > </i> <span> {'Buscar'} </span> </button>
        <button style={{width: '30%'}} className="nav-button" onClick={ ()=>{ props.setEstado('cuenta') } } > <i className={props.icon + ' navIcon'} > </i> <span> {'cuenta'} </span> </button>
      </div>
    );
}

export default HeaderTitle;
